import React, { Component } from "react";
import routes from "../../InnerRoutes";

export default class Content extends Component {
  render() {
    return (
      <div id="pageWrapper">
        <Switch>
          {routes.map(
            (route, index) => (
              console.log(route.main),
              (
                <Route
                  key={index}
                  path={route.path}
                  exact={route.exact}
                  strict
                  render={() => <route.main />}
                />
              )
            )
          )}
        </Switch>
      </div>
    );
  }
}
